import React from 'react';
import './App.css';

function App() {
  return (
    <div className="app-wrapper">
        <header className='header'>
            <img src="https://image.shutterstock.com/image-vector/dots-letter-c-logo-design-260nw-551769190.jpg" alt="Logo"/>
        </header>
        <nav className='nav'>
            <div>
                Profile
            </div>
            <div>
                Messages
            </div>
        </nav>
        <div className='content'>
            Main content
        </div>
    </div>
  );
}

export default App;
